    .menux input[type="checkbox"] {
      opacity: 0;
      position: absolute;
      left: -9999px;
    }
    .menux a, .menux .toggle-menux {
      color: #0D7811; 
      text-decoration: none;
      -webkit-transition: .3s all ease;
      transition: .3s all ease;
    }
    .menux a:hover, .menux .toggle-menux:hover {
      color: #E3DFE6;
    }
    .menux .toggle-menux {
      display: none;
      padding-left: 10px;
    }
    .menux .toggle-menux:hover {
      cursor: pointer;
    }
    @media screen and (max-width: 999px) {
      .menux .toggle-menux {
        display: block;
      }
    }
    @media screen and (max-width: 999px) {
      .menux .nav {
        background: #e0ede1;
        position: relative;
        height: 100%;
        width: 180px;
	margin-top: 0px;
        left: 0;
        -webkit-transition: .3s all ease;
        transition: .3s all ease;
        -webkit-transform: translateX(-340px);
                transform: translateX(-340px);
        overflow-y: auto;
        font-size: 18px;
      }
      .menux #toggle-responsive:checked ~ .nav {
        -webkit-transform: translateX(0);
                transform: translateX(0);
      }

  	.menux ul > li {
   		 position: relative;
    		padding: 10px 10px 10px 40px;
    		width: 180px;
    		height: 40px;
		margin-bottom: 10px !important;
	}
    }
    .menux label.toggle {
      color: transparent;
      position: relative;
    }
    .menux label.toggle:hover {
      cursor: pointer;
    }
    .menux label.toggle:hover:before {
      width: 0;
      height: 0;
      border-style: solid;
      border-color: transparent transparent transparent #E3DFE6;
      border-width: 5.33333px;
    }
    .menux label.toggle:before {
      content: "";
      font-size: 16px;
      -webkit-transition: .3s all ease;
      transition: .3s all ease;
      position: absolute;
      top: 50%;
      left: 5px;
      -webkit-transform: translateY(0%) rotate(90deg);
              transform: translateY(0%) rotate(90deg);
      width: 0;
      height: 0;
      border-style: solid;
      border-color: transparent transparent transparent #262626;
      border-width: 5.33333px;
    }
    @media screen and (max-width: 999px) {
      .menux label.toggle:before {
        left: 15px;
      }
    }
    .menux ul {
      position: relative;
    }
    .menux ul,
    .menux ul li {
      list-style: none;
      padding: 0;
      margin: 0;
    }
    .menux ul > li {
      position: relative;
      padding: 10px 10px 10px 40px;
    }
    @media screen and (min-width: 1000px) {
      .menux ul > li {
        display: inline;
        padding: 0 10px;
      }
    }
